import React from 'react';
import { BrowserRouter,Route,Routes} from 'react-router-dom';

import './App.css';

function App() {
  return (
    <BrowserRouter>
     <Routes>
       <Route exact path="/Login" element={<Login/>}></Route>
       <Route exact path="/Register" element={<Register/>}></Route>
     </Routes>
    </BrowserRouter>
  );
}

export default App;
